@Hockeyweb Hi, we are unfortunaly not able to assist you with individual booking matters through social media. I must kindly ask you to contact our phone support at: https://t.co/cXegppNuM6
Best regards,
Viktoria

@malenamalandra Hi Malena, I am so sorry to hear that you had a bad experience with us. If you want to leave feedback and tell us about your experience you can do it here: https://t.co/cXegpq5E0e
Kind regards,
Viktoria

@Vaflerogelg Hi, I am sorry to hear about the incovience. If you want a status update on your case you can contact our live support here: https://t.co/n8PFpuYvEn
Kind regards, 
Viktoria

@RichyP85 Hi Ricky, I am sorry to hear about the incovience. There is a limited space for animals on our flights, if you need help to check availability before booking please contact our live support here: https://t.co/n8PFpuYvEn
Kind regards, 
Viktoria

@inna76se Hello, right now we have a lot of cases to deal with and the handling times are longer than usual. Unfortunately we cannot estimate the time until you receive an answer. I apologize for the long handling time.
Best regards,
Stina

@judd_ferrer Hello, we need to look at your booking to see the reason, please contact us by phone or chat: https://t.co/O6Jy9v8M7c
Best regards,
Stina

@AlekseyShmyrin Hi, we cannot estimate the time unfortunately, I apologize for the long handling time. Once your case is handled you will receive an email from our customer care department. 
Best regards,
Stina

@Andersupeders Hej, jag är ledsen att höra att du fått det meddelandet. Försök att skicka ditt svar på nytt vid ett senare tillfälle och se till att du svarar på den senaste e-posten du fått utan att ändra på email eller ämnesraden.
Vänliga hälsningar,
Rebecka

@zamv16 Hej,
För tillfället har jag ingen information om det. Jag rekommenderar att du håller utkik på vår hemsida.
Med vänliga hälsningar, Lena

@missis_noir @missis_noir Hi, please try another browser. We recommend using Google Chrome. If that doesn't help, please contact us via our live chat or by phone and we will help you book your flight https://t.co/b3QIqPk7bj
We apologize for any inconvenience.
Kind regards, Mikael.

@pbljung Hi, I am sorry to hear your bag was lost. You can seek your compensation for your lost bag here: https://t.co/zItZlSXhJp
If you have already made a claim, you can contact our customer service for a status update: https://t.co/b3QIqPk7bj
Kind regards, Rebecka

@SbastienFaucon3 Hello, we are sadly not able to assist with individual booking matters through social media. I must kindly ask that you contact us again on live chat or phone for help https://t.co/b3QIqPk7bj

Best regards,
Anton.

@cybermazz @cybermazz Hi, I'm sorry to hear your bag is delayed. You need to contact the Baggage Service linked to the airport where you landed.
You should be able to contact them via a form on this website: https://t.co/2zwsPbhQFU
Kind regards, Mikael.

@pyramose @pyramose Hi, I am sorry to hear your bag is delayed. You need to contact the Baggage Service for more assistance. You can do so via this website: https://t.co/2zwsPbhQFU
You can read more about delayed baggage on our website: https://t.co/KQdOdrH9TM
Kind regards, Mikael

@SwedeLifeUSA Hello, the best way to contact our customer care department is to reply directly to the email you received with your case number. For a status update, please contact our customer service here: https://t.co/b3QIqPk7bj

Kind regards,
Tyra

@pkipler Hej, jag är ledsen att höra att din resa blev inställd, vänligen kontakta vår customer service så vi kan se på de möjligheter som finns för dig. Du kan kontakta oss på live chat och telefon här: https://t.co/z4gOZAAJQJ 
Vänliga hälsningar,
Rebecka

@josphatzk @josphatzk Hi, when you've reported your delayed baggage you can track your bag here: https://t.co/2zwsPbhQFU or call baggage service for more info: https://t.co/ZV9bTO3uo2
I would advice to delete this tweet due to private info: your booking reference.
Kind regards, Mikael

@antoniojaen @antoniojaen Hi, I'm sorry to hear your bag is delayed. Unfortunately we have no access to that system, Baggage Service will contact you when they have more info.
You can find more information about delayed baggage on our website: https://t.co/KQdOdrH9TM
Kind regards, Mikael.

@DiegoCastaneda @DiegoCastaneda Hi, please contact us via our live or by phone and we will help you arrange this. We apologize for any inconvenience
https://t.co/b3QIqPk7bj
Kind regards, Mikael.

@chamirafernando Hi, we apologize for the long handling time of claims. Our Customer care is working as quickly as possible to get to your claim, unfortunately all claims handling times are longer than usual currently due to the recent pilot strike.

Best regards,
Anton.

@Isaac_Lumu84 Hello, I recommend you to contact our Baggage service support to see if they can correct this for you https://t.co/We1FdD7ZiM

Best regards,
Anton.

@misssamantham Hi, please contact us on live chat https://t.co/b3QIqPk7bj with your booking reference and we can help you take a look at the refund rules of your ticket(s).

Best regards,
Anton.

@avladl Hi, the general procedure is that the damaged baggage must be reported at the airport within 7 days, I apologize if you were informed otherwise when at the airport. When the damaged bag report is made, please register a claim also at https://t.co/zItZlSXhJp

Best regards,
Anton.

@DavidAEisner @DavidAEisner Hi, I am sorry to hear your bag is delayed. I can't check the status in my system, that is handled by the Baggage Service.
